import React from 'react'

function Weather() {
    return (
        <>
            <div className="container">
                <div className="wrap">
                    <input type="search" placeholder="Search..." className="search searchTerm" autoFocus id="search"/>
                    <button className="searchButton">Search</button>
                </div>
                <article className="widget">
                    
                </article>
            </div>
        </>
    )
}

export default Weather;
